import React from 'react'

export default function AddProduct(props) {
    return (
        <div>
            <select>
                <option value="sterio">Sterio</option>
                <option value="boiler">Boiler</option>
                <option value="lemp">Lemp</option>
            </select>
            <button>Add</button>
        </div>
    )
}
